import React from "react";

const updateRadar = ({droneData}) => {
    var c = document.getElementById("radarcanvas");
    var ctx = c.getContext("2d");
    ctx.clearRect(0, 0, c.width, c.height);
    //ctx.moveTo(0, 125);
    ctx.lineTo(250, 125);
    ctx.stroke(); 
};

export default updateRadar;
